import { View, Text, ScrollView, TouchableOpacity, Image } from "react-native";
import React, { useState } from "react";
import { SafeAreaView } from "react-native-safe-area-context";
import { LinearGradient } from "expo-linear-gradient";
import { storeColors } from "../theme";
import GradientButton from "../components/gradientButton";

const categories = ["Active", "Completed"];

const games = [
  {
    id: 1,
    title: "Shadow Fight",
    image: require("../assets/images/shadowFight.png"),
    downloads: "20M",
    stars: 4.5,
  },
  {
    id: 2,
    title: "Valor Arena",
    image: require("../assets/images/valorArena.png"),
    downloads: "10k",
    stars: 3.4,
  },
];

export default function BuyerOrder() {
  const [activeCategory, setActiveCategory] = useState("Active");
  const [selectedGame, setSelectedGame] = useState(null);
  return (
    <LinearGradient
      colors={["rgba(58, 131, 244,0.4)", "rgba(9, 181, 211, 0.4)"]}
      className="w-full flex-1"
    >
      <SafeAreaView>
        <View className="container">
          {/* categories */}
          <View className="mt-3 space-y-4">
            <Text
              style={{ color: storeColors.text }}
              className="ml-4 text-3xl font-bold"
            >
              Browse Orders
            </Text>
            <View className="pl-4">
              <ScrollView horizontal showsHorizontalScrollIndicator={false}>
                {categories.map((cat) => {
                  if (cat == activeCategory) {
                    // show gradient category
                    return (
                      <GradientButton
                        key={cat}
                        containerClass="mr-2"
                        value={cat}
                      />
                    );
                  } else {
                    // show normal category
                    return (
                      <TouchableOpacity
                        onPress={() => setActiveCategory(cat)}
                        key={cat}
                        className="bg-blue-200 p-3 px-4 rounded-full mr-2"
                      >
                        <Text>{cat}</Text>
                      </TouchableOpacity>
                    );
                  }
                })}
              </ScrollView>
            </View>
          </View>

          {/* top action games list */}
          <View className="mt-3">
            <ScrollView showsVerticalScrollIndicator={false}>
              {games.map((game, index) => {
                let bg = "rgba(255,255,255,0.4)";
                return (
                  <TouchableOpacity
                    style={{ backgroundColor: bg }}
                    className="mx-4 p-2 mb-2 flex-row rounded-3xl"
                    onPress={() => setSelectedGame(game.id)}
                    key={index}
                  >
                    <Image
                      source={game.image}
                      style={{ width: 80, height: 80 }}
                      className="rounded-2xl"
                    />
                    <View className="flex-1 flex justify-center pl-3 space-y-3">
                      <Text
                        style={{ color: storeColors.text }}
                        className="font-semibold"
                      >
                        {game.title}
                      </Text>
                      <View className="flex-row space-x-3">
                        <View className="flex-row space-x-1">
                          <Image
                            className="h-4 w-4 opacity-80"
                            source={require("../assets/images/fullStar.png")}
                          />
                          <Text className="text-xs text-gray-700">
                            {game.stars} stars
                          </Text>
                        </View>
                      </View>
                    </View>
                    <View className="flex justify-center items-center">
                      <GradientButton value="play" buttonClass="py-2 px-5" />
                    </View>
                  </TouchableOpacity>
                );
              })}
            </ScrollView>
          </View>
        </View>
      </SafeAreaView>
    </LinearGradient>
  );
}
